    return (
        <div>
            <a>Let's connect</a>
            <div className="flex flex-row">
                <input
                    placeholder="Nickname..."
                    style={{
                        color: "#ffffff",
                        backgroundColor: "rgba(212, 213, 214, 1)",
                        borderWidth: 2,
                        borderColor: 'black',
                        borderRadius: "8px",
                        padding: "10px",
                        border: "none",
                        outline: "none",
                        marginRight: "8px",
                    }}
                />
                <IconButton icon={iconsRef.plusUser} onClick={handleSearch} />
            </div>
        </div>
    );
};

const IconButton = ({ icon, onClick }: { icon: string, onClick: () => void }) => {
    const size = 27;

    return (
        <img
            src={icon}
            width={size}
            height={size}

            onClick={onClick}
            style={{ cursor: 'pointer', padding: 4, paddingLeft: 5, paddingTop: 5, background: '#4f4f4f', borderRadius: 10 }}
        />
    );
};

export default SearchBar;
